const initialState = {
    weatherToday: {}
}

export const WeatherReducer = (state = initialState, action) => {
    switch (action.type) {

        case "GET_DATA_TODAY": {
            state.weatherToday = action.weatherToday;

            return { ...state}
        }

        default: {
            return { ...state}
        }
    }
}
